function buildSocialButton(width, color, design, direction, hoverEffect, activationEffect, name) {
  var product = networks[name];
  color = color || product.color;
  var btnStyle = `width:${width}; height:${width};`;
  var innerStyle = "";

  if (design == 'fill') {
    btnStyle += `background-color: ${color};background: ${color};`;
    innerStyle += `border-color: ${color};fill: #ffff;stroke: ${color};color: ${color};`;
  } else if (design == 'stroke') {
    innerStyle += `border-color: ${color};fill: ${color};stroke: ${color};color: ${color};`;
  } else if (design == 'solid') {
    btnStyle += 'box-shadow: none;'
    innerStyle += `fill: ${color};color: ${color};border: none; filter: drop-shadow( 2px 2px 3px #999);`;
  } else if (design == 'bar') {
    btnStyle += `background-color: ${color};background: ${color};fill: #ffff;`;
  }
  if (design == 'bar') {
    return `<div class="social side-icons" data-network-type="${name}" onclick="${product.action}" style="${btnStyle}">
    <div style="${btnStyle}">
        ${product.icon}
        </div>
        <!--div class="count-container">
          <div class="count">1</div>
        </div-->
    </div>`;
  }
  return `<div class="social ${direction} side-icons ${hoverEffect} ${activationEffect}" data-network-type="${name}" onclick="${product.action}" style="${btnStyle}">
    <div class="style-root" style="${innerStyle}">
      <div class="shockwave"></div>
      ${product.icon}
      <svg fill="${color}" xmlns="http://www.w3.org/2000/svg" viewBox="-10 -10 20 20">
          <g class="sparkle">
          <g><circle cx="0" cy="0" r="1"></circle></g><g><circle cx="0" cy="0" r="1"></circle></g><g><circle cx="0" cy="0" r="1"></circle></g><g><circle cx="0" cy="0" r="1"></circle></g><g><circle cx="0" cy="0" r="1"></circle></g>
          </g>
        </svg>
      <!--div class="count-container">
        <div class="count">1</div>
      </div-->
    </div>
  </div>`;
}

function buildSocialBar(btnList, location, btnWidth, color, design, direction, hoverEffect, activationEffect) {
  var fn = buildSocialButton.bind(undefined, btnWidth, color, design, direction, hoverEffect, activationEffect)
  var socialButtons = btnList.map(fn);
  var locationStyle = "";
  if (location['left']) { locationStyle +="left:"+location['left']+";" }
  if (location['right']) { locationStyle +="right:"+location['right']+";" }
  if (location['top']) { locationStyle +="top:"+location['top']+";" }
  if (location['bottom']) { locationStyle +="bottom:"+location['bottom']+";" }
  var id = design == 'bar' ? "social-bar" : "social-circles";
  return `
  <div id="${id}" style="${locationStyle}">
    ${socialButtons.join("")}
  </div>`;
}


$(document).ready(function() {
  $('outreach-bar').each(function() {
    var btnList = $(this).attr('social-buttons').split(',');
    var location = {left: "0px"}
    var design = $(this).attr("design") || "stroke";
    if (design != 'bar') {
      location = {
        top: $(this).attr("top"),
        bottom: $(this).attr("bottom"),
        left: $(this).attr("left"),
        right: $(this).attr("right"),
      }
    }
    var btnWidth = $(this).attr("width");
    var color = $(this).attr("color");
    var direction = $(this).attr("direction") || 'vertical';
    var hoverEffect = $(this).attr("hover-effect");
    var activationEffect = $(this).attr("activation-effect")
    $(this).html(buildSocialBar(btnList, location, btnWidth, color, design, direction, hoverEffect, activationEffect));
    $(this).fadeIn("slow");
    if (design == "bar") {
      $(this).find('.social').mouseenter(function(){
        $(this).css("width", parseInt(btnWidth) * 1.5);
        $(this).css("height", parseInt(btnWidth));
      }).mouseleave(function(){
        $(this).css("width", parseInt(btnWidth));
      });
    }
    $(this).find('.social').click(function(){
      var networkName = $(this).data('network-type');
      if (networks[networkName].activeIcon) {
        $(this).find('svg').first().replaceWith(networks[networkName].activeIcon);
      }
      $(this).addClass('activated')
    });
  })
})
